INSERT INTO `tm_pengaturan` (`id`, `pengaturan`, `val`) VALUES (7, 'konten wa', '_*Bukti Pengambilan Undangan HUTRI-75*_\nKepada Yth Bapak/ibu/Saudara:\n{nama}\nNIK : {nik}\nSelamat permohonan anda untuk menghadiri upacara HUT RI-75 di istana negara telah disetujui.\\\n\n_*Perolehan undangan :*_\n{acara_penaikan}\n{acara_penurunan}\n{acara_renungan}\n\n_*Undangan dapat diambil pada :*_\nhari {waktu_pengambilan}\npukul 08.30 - 16.00 WIB.\n\n_*Persyaratan pengambilan*_\n- membawa KTP/tanda pengenal asli sesuai yang anda daftarkan.\n- Menunjukan bukti notifikasi pengambilan yang telah kami kirimkan ke Email,whatsapp dan sms.\n- Jika Undangan tidak diambil  lebih dari 3 hari dari tanggal pengambilan maka otomatis dibatalkan.\n- Alamat pengambilan undangan :\n{icon1}Kantor Sekretariat Negara\n{icon2}Jl. Veteran No.17-18, RT.2/RW.3, Gambir, Kecamatan Gambir, Kota Jakarta Pusat.\n\nTerimakasih atas partisipasi anda.');
