INSERT INTO `tm_pengaturan` (`id`, `pengaturan`, `val`) VALUES (36, 'strukture table view', ' CREATE OR REPLACE VIEW `v_blok` AS SELECT\r\n*,\r\n  (SELECT\r\n     COUNT(0)\r\n   FROM `data_peserta`\r\n   WHERE ((`data_peserta`.`blok1` = `tr_blok`.`id`)\r\n          AND (`data_peserta`.`sts_acc` <> 3) AND hps IS NULL )) AS `jml`\r\nFROM `tr_blok`\r\nWHERE (`tr_blok`.`jenis` = 1)UNION ALL SELECT\r\n                                         *,\r\n                                         (SELECT\r\n                                            COUNT(0)\r\n                                          FROM `data_peserta`\r\n                                          WHERE ((`data_peserta`.`blok2` = `tr_blok`.`id`)\r\n                                                 AND (`data_peserta`.`sts_acc` <> 3) AND hps IS NULL)) AS `jml`\r\n                                       FROM `tr_blok`\r\n                                       WHERE (`tr_blok`.`jenis` = 2);\r\n\r\n\r\nCREATE OR REPLACE VIEW `v_distribusi` AS \r\nSELECT \'blok\' AS `blok`,\'jml\' AS `jml`,\'jadwal_distribusi\' AS `jadwal_distribusi`,\r\n\'jenis\' AS `jenis` UNION ALL SELECT `data_peserta`.`blok1` AS `blok`,COUNT(0) AS `jml`,\r\n`data_peserta`.`jadwal_distribusi` AS `jadwal_distribusi`,1 AS `1` FROM `data_peserta` \r\nWHERE ((`data_peserta`.`jadwal_distribusi` IS NOT NULL) AND (`data_peserta`.`sts_acc` = 2) \r\nAND `data_peserta`.`blok1` IN (SELECT `tr_blok`.`id` FROM `tr_blok` WHERE (`tr_blok`.`jenis` = 1))) \r\nGROUP BY `data_peserta`.`blok1`,`data_peserta`.`jadwal_distribusi` UNION ALL SELECT `data_peserta`.`blok2` AS `blok`,\r\nCOUNT(0) AS `jml`,`data_peserta`.`jadwal_distribusi` AS `jadwal_distribusi`,2 AS `2` FROM `data_peserta` \r\nWHERE ((`data_peserta`.`jadwal_distribusi` IS NOT NULL) AND (`data_peserta`.`sts_acc` = 2) AND `data_peserta`.`blok2` \r\nIN (SELECT `tr_blok`.`id` FROM `tr_blok` WHERE (`tr_blok`.`jenis` = 2))) GROUP BY `data_peserta`.`blok2`,`data_peserta`.`jadwal_distribusi`;\r\n\r\n\r\n\r\n\r\n\r\n CREATE OR REPLACE VIEW  `v_kab` AS \r\nSELECT\r\n  `wil_kabupaten`.`id_kab`   AS `id_kab`,\r\n  `wil_kabupaten`.`id_prov`  AS `id_prov`,\r\n  `wil_kabupaten`.`nama`     AS `nama`,\r\n  `wil_kabupaten`.`id_jenis` AS `id_jenis`,\r\n  (SELECT\r\n     COUNT(0)\r\n   FROM `data_peserta`\r\n   WHERE ((`data_peserta`.`id_kota` = `wil_kabupaten`.`id_kab`)\r\n          AND (`data_peserta`.`id_kategory` = 1)\r\n          AND (`data_peserta`.`jenis_acara` IN(1,2,3))\r\n          AND (`data_peserta`.`sts_acc` <> 3))) AS `jml`\r\nFROM `wil_kabupaten`;\r\n\r\n\r\n\r\n CREATE OR REPLACE VIEW  `v_prov` AS \r\nSELECT\r\n  `wil_provinsi`.`id_prov` AS `id_prov`,\r\n  `wil_provinsi`.`nama`    AS `nama`,\r\n  (SELECT\r\n     COUNT(0)                 AS `jml`\r\n   FROM `data_peserta`\r\n   WHERE ((`data_peserta`.`id_provinsi` = `wil_provinsi`.`id_prov`)\r\n          AND (`data_peserta`.`id_kategory` = 1)\r\n		  AND (`data_peserta`.`jenis_acara` IN(1,2,3))\r\n          AND (`data_peserta`.`sts_acc` <> 3))) AS `jml`\r\nFROM `wil_provinsi`;\r\n\r\n\r\n CREATE OR REPLACE VIEW  `v_peserta` AS \r\nSELECT *,\r\n  IF((`delimiter`.`jenis_acara` = 3),2,1) AS `jml_undangan`\r\nFROM `data_peserta` `delimiter`;');
